full_text:
@claudegcam 1000%! It laid an excellent foundation :)

I think the thing that annoys me about that dude's course is the implication that in 2wks you'll be a pro.

I just started being happy with my work 3yrs ago. Becoming a pro takes time &amp; opportunities, not a 2wk course. *mic drop* lol

@RyanSkursky Best piece of advice I've ever been given: don't put anything on a credit card you can't pay off.

20% interest is absolutely criminal, and they used to charge interest on the interest (not sure if they still do). 

Compound interest is only fun if on money that's invested.

@stephanieabaird Right?! Same! First year I made good money I paid off my debts, then crammed a bunch into savings. Felt great, I thought I was going into the following year finally ahead!

Turns out, that entire savings account went to taxes.

I readjusted and smartened up real quick.

@Amanda11607834 @kcorr54 @Clare_OC @KatyTurNBC Overall, I am very happy with the healthcare I've received in my 29yrs.

There's a few not so great experiences, but they're chalked up to a few bad doctors.

I have never had to factor in finances when it comes to prioritizing my health, &amp; that's a weight I'm glad I don't bear.

